import React ,{Component} from 'react';
import 'bootstrap/dist/css/bootstrap.css';
import { Nav, Navbar, NavbarBrand, NavbarToggler,NavItem, Dropdown, DropdownToggle, DropdownMenu, DropdownItem ,Button} from 'reactstrap';
import {useHistory, NavLink, Redirect} from 'react-router-dom';
import './navi.css';
import {connect} from 'react-redux';


class Navi extends Component
{
render() {
    const {isAuthenticated} = this.props.auth;

    const userLinks =(
        <Nav navbar className="ml-auto">
            <NavItem>
                <NavLink className="nav-link" to='/home'><span
                    className="fa fa-home fa-lg"></span> Home</NavLink>
            </NavItem>
            <NavItem>
                <NavLink className="nav-link" to='/home'><span
                    className="fa fa-sign-out fa-lg"></span> Log Out
                </NavLink>
            </NavItem>
        </Nav>
    );
    const guestLinks =(
        <Nav navbar className="ml-auto">
        <NavItem>
            <NavLink className="nav-link" to='/home'><span
                className="fa fa-user fa-lg"></span>Login</NavLink>
        </NavItem>
        </Nav>

    );

    return (
        <div>
            <Navbar className="fixed-top" dark expand="md">
                <div className="container-fluid">
                    <NavbarToggler/>
                    <NavbarBrand className="mr-auto" href="/"><h3>Wallet as a Service</h3></NavbarBrand>
                    {isAuthenticated ? userLinks : guestLinks}




                </div>
            </Navbar>

        </div>
    );
}
}

Navi.propTypes = {
    auth : React.PropTypes.object.isRequired
}

function mapStateToProps(state){
    return{
        auth : state.auth
    }
}

export default connect(mapStateToProps)(Navi);

